import React, { Component } from "react";
import SearchResults from "./components/search_results";
import DatasetPage from "./components/dataset_page";
import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Header from "./components/header";
import Footer from "./components/footer";


class App extends Component {



  render() {
    var app_ver = process.env.REACT_APP_APP_VERSION;
    var data_ver = process.env.REACT_APP_DATA_VERSION;
    return (
      <div>
      <Header onSearch={this.handleSearch} onKeyPress={this.handleKeyPress}/>
      <div className="versioncn">APP Version {app_ver}, Data Version {data_ver}</div>
      <Router>
        <Switch>
          <Route
            path="/:bcoId"
            render={(props) => (
              <DatasetPage
                bcoId={props.match.params.bcoId}
              />
            )}
          />
          <Route
            exact
            path="/"
            render={(props) => (
              <SearchResults/>
            )}
          />
        </Switch>
      </Router>
      <Footer />
      </div>
    );


  }
}

export default App;
